import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { params } from './params'; // Assuming params is correctly imported

export default function FullParameterList({ param_type }) {
    const [products, setProducts] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        if (param_type == 'standard') {
            params.getStandardParams()
                .then(data => setProducts(data))
                .finally(() => setLoading(false));


        }

        else if (param_type == 'advanced') {
            console.log('advanced')
        }

        else {
            const data = params.getFullParams()[0]
            setProducts(data)
            console.log('full',data)
        }

    }, []);

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p> // Add a loading message
            ) : products.length === 0 ? (
                <p>No data available.</p> // Handle empty data case
            ) : (
                <DataTable value={products} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    <Column field="code" header="Code"></Column>
                    <Column field="name" header="Name"></Column>
                    <Column field="category" header="Category"></Column>
                    <Column field="quantity" header="Quantity"></Column>
                </DataTable>
            )}
        </div>
    );
}
